import React from "react";
import "./FlyNavbar.css";

const FlyNavbar = () => {
  return (
    <>
      <div className="dropdown">
        <button className="mainmenubtn">Nav</button>
        <div className="dropdown-child">
        </div>
      </div>
    </>
  );
};

export default FlyNavbar;
